webpackJsonp([0xcba9d99457de],{423:function(e,t){e.exports={data:{markdownRemark:{html:"<blockquote>\n<p>Message 1403 : Thu Jun  2 (Vakaur)     :: Guardian</p>\n</blockquote>\n<p>Guardian has been altered to provide three options to its caster:\naggressive, defensive and mystic.  This option must be provided by\nthe caster when casting the spell, and depending on the choice of\nthe caster, a guardian proficient in offense, defense or mystical\naptitude will be created to guard its master.  As a result, the\nspirit cost of creating a guardian has been increased.</p>\n<p>Vakaur</p>",frontmatter:{title:"News 1403: Guardian",date:"October 09, 2017",author:null,desc:null}}},pathContext:{slug:"/news/1403"}}}});
